import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Register from './register';
import Login from './login';
import styles from './landing.module.css';
import Gymbro from './gymbro';


function Landing() {
    return <Router>
        <div className={styles.landingBody}>

            <img src="/ellipse.png" alt="Ellipse" className={styles.ellipseImage} />


            <img src="/landimg.png" alt="Running Woman" className={styles.runningWomanImage} />


            <div className={styles.largeText}>DUMBLE.</div>

            <nav className={styles.landingNav}>
                <Link to="/">
                    <img
                        src="/logo192.png"
                        alt="logo"
                        className="App-logo"
                        width={50}
                        height={50}
                    />
                </Link>

                <div>
                    <Link to="/login" className={styles.App-link}>Login</Link>
                    <Link to="/register" className={styles.App-link}>Register</Link>
                    <Link to="/gymbro" className={styles.App-link}>Gymbro</Link>
                </div>
            </nav>

            <Routes>
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/gymbro" element={<Gymbro />} /> {/* This is the new route */}
                <Route path="/" />
            </Routes>

        </div>
    </Router>;
}

export default Landing;
